import{_ as a}from"./chunks/dashboard-features.f31dceb5.js";import{_ as e}from"./chunks/users.902f6a48.js";import{_ as i}from"./chunks/admin-ui-logging.b8e55449.js";import{_ as r}from"./chunks/admin-ui-redis.384233c6.js";import{_ as s}from"./chunks/admin-ui-database.a4fdf62a.js";import{_ as d,o as n,c as t,a as o}from"./app.2aea72c0.js";var l="/assets/admin-ui-validation.a2960abb.png";const x='{"title":"Admin UI","description":"","frontmatter":{"slug":"admin-ui","title":"Admin UI"},"headers":[{"level":2,"title":"Dashboard","slug":"dashboard"},{"level":3,"title":"Advertized features","slug":"advertized-features"},{"level":2,"title":"Admin UI Features","slug":"admin-ui-features"},{"level":3,"title":"Managing Users UI","slug":"managing-users-ui"},{"level":3,"title":"Profiling & Logging UI","slug":"profiling-logging-ui"},{"level":3,"title":"Redis Admin","slug":"redis-admin"},{"level":3,"title":"Database Admin","slug":"database-admin"},{"level":3,"title":"DB Validation UI","slug":"db-validation-ui"},{"level":2,"title":"Feedback","slug":"feedback"}],"relativePath":"admin-ui.md"}',h={},u=o('<p>The Admin UI contains a suite of Admin tools providing a number of productivity features ranging from Managing Users and DB Validation Rules to gaining unprecedented insights into Live running Apps with in-depth Request Logging &amp; Profiling where you&#39;ll be able to observe your App&#39;s behavior in real-time.</p><p>The <a href="/admin-ui">Admin UI</a> is built into all ServiceStack Apps, accessible to <a href="/debugging#admin-role">Admin Users</a> from:</p><div class="text-center pb-3"><h3 class="text-4xl text-indigo-800">/admin-ui</h3></div><h2 id="dashboard" tabindex="-1">Dashboard <a class="header-anchor" href="#dashboard" aria-hidden="true">#</a></h2><p>On first access you&#39;re greeted with the Admin dashboard showing high-level overview stats on the number and type of APIs your App has as well as internal stats counters surfaced right on your Dashboard where they can provide valuable insights into the health of different features at a glance:</p><p><img src="'+a+'" alt=""></p><h3 id="advertized-features" tabindex="-1">Advertized features <a class="header-anchor" href="#advertized-features" aria-hidden="true">#</a></h3><p>As Admin is a capability-based UI it only shows the stats and features your App has enabled. To aid in discovery the dashboard now includes a light switch of available Admin features with a link to <a href="/admin-ui-features">Admin UI Feature Docs</a>, providing a summary of each Admin UI component and instructions on how to enable them.</p><h2 id="admin-ui-features" tabindex="-1">Admin UI Features <a class="header-anchor" href="#admin-ui-features" aria-hidden="true">#</a></h2><p>Explore the available Admin UIs to learn more about each of their capabilities:</p><h3 id="managing-users-ui" tabindex="-1"><a href="/admin-ui-users">Managing Users UI</a> <a class="header-anchor" href="#managing-users-ui" aria-hidden="true">#</a></h3><p>Containing user management functionality for creating &amp; modifying users, assigning Roles &amp; Permissions, locking or updating passwords:</p><a href="/admin-ui-users"><div class="block p-4 rounded shadow hover:shadow-lg"><img src="'+e+'"></div></a><h3 id="profiling-logging-ui" tabindex="-1"><a href="/admin-ui-profiling">Profiling &amp; Logging UI</a> <a class="header-anchor" href="#profiling-logging-ui" aria-hidden="true">#</a></h3><p>Enables invaluable observability into your App, from being able to quickly inspect and browse incoming requests, to tracing their behavior:</p><a href="/admin-ui-profiling"><div class="block p-4 rounded shadow hover:shadow-lg"><img src="'+i+'"></div></a><h3 id="redis-admin" tabindex="-1"><a href="/admin-ui-redis">Redis Admin</a> <a class="header-anchor" href="#redis-admin" aria-hidden="true">#</a></h3><p>Manage your App&#39;s configured Redis Server, query &amp; edit core Redis data types and execute custom redis commands:</p><a href="/admin-ui-redis"><div class="block p-4 rounded shadow hover:shadow-lg"><img src="'+r+'"></div></a><h3 id="database-admin" tabindex="-1"><a href="/admin-ui-database">Database Admin</a> <a class="header-anchor" href="#database-admin" aria-hidden="true">#</a></h3><p>Quickly browse and navigate your App&#39;s configured RDBMS schemas and tables:</p><a href="/admin-ui-database"><div class="block p-4 rounded shadow hover:shadow-lg"><img src="'+s+'"></div></a><h3 id="db-validation-ui" tabindex="-1"><a href="/admin-ui-validation">DB Validation UI</a> <a class="header-anchor" href="#db-validation-ui" aria-hidden="true">#</a></h3><p>Leverages the existing Declarative Validation infrastructure to enable dynamically managing Request DTO Type and Property Validators from a RDBMS data source</p><a href="/admin-ui-validation"><div class="block p-4 rounded shadow hover:shadow-lg"><img src="'+l+'"></div></a><h2 id="feedback" tabindex="-1">Feedback <a class="header-anchor" href="#feedback" aria-hidden="true">#</a></h2><p>The Admin UI was designed with room to grow. Please let us know what other features you would like to see on our <a href="https://github.com/ServiceStack/Discuss/discussions/2" target="_blank" rel="noopener noreferrer">GitHub Discussions</a>.</p>',27),c=[u];function m(g,p,f,b,v,_){return n(),t("div",null,c)}var D=d(h,[["render",m]]);export{x as __pageData,D as default};
